INSERT INTO `review_class` (`class_id`, `sort_id`, `title`, `status`, `guide`, `create_time`, `create_by`) VALUES ('ff80808150a73aa20150a83a3fca00e2',1,'北京市保安员心理健康水平测评系统',1,'    总指导语：大家好！欢迎参加本次保安员心理测评。本测评是根据保安员职业特点编制而成，共包括两个部分：基本能力测评和心理特征测评。请您根据指导语完成本测评。请您保证诚实回答本量表全部条目。  （一）心理特征测试量表：     心理特征测验指导语：您好（大家好）！以下题目主要针对保安员常见心理特征编制，每个题目都没有对错之分，请根据您自己的实际情况选择合适的答案，填图在答题卡上，谢谢您的合作。',NULL,'4028d881436d514601436d5215ac0043'),('ff80808150f99d8a0150f9a31bc80025',21,'益测试',0,'只是测试',NULL,'4028d881436d514601436d5215ac0043'),('ff808081525dadff015335cb1f2a02cb',3,'焦虑自评（SAS）',1,'焦虑是一种比较普遍的精神体验，长期存在焦虑反应的人易发展为焦虑症。本量表包含20个项目，分为4级评分，请您仔细阅读以下内容，根据最近一星期的情况如实回答。 填表说明：所有题目均共用答案，请在A、B、C 、D下划“√”，每题限选一个答案。',NULL,'ff808081525dadff01532ff5649b01af'),('ff808081525dadff01533650f0920356',4,'抑郁自评（SDS）',1,'本量表包含20个项目，分为4级评分，为保证调查结果的准确性，务请您仔细阅读以下内容，根据最近一星期的情况如实回答。 填表说明：所有题目均共用答案，请在A、B、C 、D下划“√”，每题限选一个答案',NULL,'ff808081525dadff01532ff5649b01af'),('ff808081525dadff0153365ddc5303e4',5,'成就动机测评（AMS）',1,'请你仔细阅读每一个题目，根据自己的实际情况做出判断，如果某个句子所描述的情况和你的情况非常符合，请在相应题号中选A； 如果句子描述的情况和你的情况比较符合，请在相应题号中选B； 如果比较不符合，请选C；如果非常不符合，请选D。 每一个问题都请做答。 请注意:例如:“我喜欢独自工作”，如果很喜欢独自工作，但又害怕一个人做事，换句话说你对独自工作有矛盾心理，这不奇怪。但你要记住，这里仅仅要你回答是否喜欢独自工作，而不是问你是否害怕，因此，选择“非常符合”。  ',NULL,'ff808081525dadff01532ff5649b01af'),('ff808081525dadff01533688c4170566',15,'社会支持评定测评',0,'下面的问题用于反映您在社会中所获得的支持，请按各个问题的具体要求，根据您的实际情况写',NULL,'ff808081525dadff01532ff5649b01af'),('ff808081525dadff015336f89b4005a7',7,'心理健康症状自助测评（SCL-90）',1,'以下表格中列出了有些人可能有的病痛或问题，请仔细阅读每一条，然后根据最近一星期以内(或过去)下列问题影响你自己或使你感到苦恼的程度，请选择最合适的选项。请不要漏掉问题。',NULL,'ff808081525dadff01532ff5649b01af'),('ff808081525dadff01533b197206084b',22,'健康状况调查问卷（SF－36）',0,'以下问题是有关您健康状况的问题，如果您不知如何回答是好，就请您尽量给出最好的答案',NULL,'ff808081525dadff01532ff5649b01af'),('ff8080815373bc55015373cb1f640005',11,'人际动机量表（TRIM）',0,'请阅读下面的问题，表明对曾伤害你的人的想法和感受。用下面的量表表明你对每道题目的同意程度。',NULL,'ff808081525dadff01532ff5649b01af'),('ff8080815373bc55015373d441be0066',12,'心灵宽恕量表（HFS）',0,'在我们的生活中，因为我们自己的行为、他人的行为或我们不能控制的情境，可能会出现消极事件。在这些事情过去后的一段时间里，我们可能对我们自己、他人或情境有一些负面的想法或感受。思考一下，你对这样的消极事件的典型反应。在每道题目前面的空白处，用数字表明你同意或不同意的程度，请用数字（使用下面的7点量表）标明你对这类消极事件的典型反应。答案没有对错之分，请诚实作答。',NULL,'ff808081525dadff01532ff5649b01af'),('ff8080815373bc55015373d574c100f7',13,'助人态度量表',1,'本测试是为了测查你在与他人交往过程中的感受、观念和行为。这不是一个测验，因此对问题的回答没有对错之分。请尽可能诚实地回答这些问题。在每条陈述前面的空白处，表明你同意或不同意的程度。',NULL,'ff808081525dadff01532ff5649b01af'),('ff80808154322fcb01543d1f336e004f',12,'罗夏测验',0,'以下从左至右依次为罗夏测验的全套图片10张，这些图片在被试者面前出现的次序按标注规定，按顺序看图后依次回答',NULL,'ff808081525dadff01532ff5649b01af'),('ff80808154d2fa5101554d9ba156001e',14,'IMBT',0,'引导语',NULL,'ff80808154d2fa5101554d9054aa0017'),('ff80808154d2fa5101554de21a55025b',6,'职业性格测试量表（MBTI）',1,'1．请在心态平和及时间充足的情况下才开始答题。 2．请注意，题目的答案无对错之分，你不需要考虑哪个答案“应该”更好，而且不要在任何问题上思考太久，而是应该凭你心里的第一反应做出选择。 3．如果你觉得在不同的情境里，两个答案或许都能反映你的倾向，请选择一个对于你的行为方式来说最自然、最顺畅和最从容的答案。 请在以下范围内一一对应地选择你对以下项目的赋值： 最小至最大 0   1  2  3  4  5,请注意两个选项之和为5',NULL,'ff80808154d2fa5101554d9054aa0017'),('ff808081556cbe040155de79ae800021',2,'保安84道测试（答题卡二）',0,'指导语：下面是一些对于行为的描述，请您选择符合自己实际情况的选项所有题都没有正确错误之分，请不要做太多考虑，尽快按照您的实际情况选择就行。',NULL,'ff80808154d2fa5101554d9054aa0017'),('ff808081556cbe040155e2376bbc040e',8,'保安120道测试（答题卡一）',0,'以下题目仅有一个正确答案，限时十分钟。',NULL,'ff80808154d2fa5101554d9054aa0017'),('ff808081556cbe0401565945a9820e53',9,'新53道测试（保安）',1,'您好！欢迎参加本次保安员心理测评。本测评是根据保安员职业特点编制而成，共包括两个部分：基本能力测评和心理特征测评。请您根据指导语完成本测评。请您保证诚实回答本量表全部条目。',NULL,'ff80808154d2fa5101554d9054aa0017');
