INSERT INTO `review_report_grade` (`report_grade_id`, `report_id`, `grade_small`, `grade_big`, `result_explain`) VALUES ('ff8080815093a7e7015093fa1fa701a2','',1,5,'awr'),('ff8080815093a7e7015093fa1fb801a3','',6,11,'rdfr'),('ff8080815093a7e7015093fa1fb901a4','',12,16,'fdg'),('ff80808154322fcb01543d0a181b0041','ff80808154322fcb01543d07c079003a',0,21.9,'个体主观感受到的支持和实际得到的客观支持状况较差'),('ff80808154322fcb01543d0a181d0042','ff80808154322fcb01543d07c079003a',20,45.9,'个体主观感受到的支持和实际得到的客观支持状况正常'),('ff80808154322fcb01543d0a181d0043','ff80808154322fcb01543d07c079003a',46,100,'个体主观感受到的支持和实际得到的客观支持状况均良好'),('ff80808154d2fa5101554dc3f27d0247','ff80808154d2fa5101554dc3f27b0246',-60,0,'内倾型I\r\n独自度过时光精力充沛'),('ff80808154d2fa5101554dc3f2c90248','ff80808154d2fa5101554dc3f27b0246',1,60,'外倾型E\r\n与他人相处精力充沛'),('ff80808154d2fa5101554e464af8057f','ff80808154d2fa5101554e464af7057e',-60,0,'独自度过时光精力充沛\r\n避免成为注意的焦点\r\n思考，之后行动\r\n在心中思考问题不善于表露\r\n相对封闭，更愿意在经挑选的小群体中分享个人的信息\r\n听的比说的多\r\n不把热情表现出来\r\n仔细考虑后，才有所反应，喜欢慢节奏\r\n喜欢深度而不是广度\r\n'),('ff80808154d2fa5101554e464af90580','ff80808154d2fa5101554e464af7057e',1,60,'与他人相处精力充沛\r\n希望成为注意的焦点\r\n行动，之后思考\r\n喜欢边想边说出声\r\n易于“读”和了解；随意地分享个人信息\r\n说的比听的多\r\n高度热情地社交\r\n反应快，喜欢快节奏\r\n重于广度而不是深度\r\n'),('ff80808154d2fa5101554e64cd760587','ff80808154d2fa5101554e64cd750586',-60,0,'相信灵感和推断\r\n喜欢新思想和概念必须符合自己的意愿\r\n重视想象力和独创力\r\n喜欢学习新技能，但掌握之后很容易就厌倦了\r\n留心普遍的和有象征性的；使用隐喻和类比\r\n跳跃性地展现事实以一种绕圈子的方式\r\n着眼于未来\r\n'),('ff80808154d2fa5101554e64cd770588','ff80808154d2fa5101554e64cd750586',1,60,'相信确定和有型的事物\r\n喜欢新想法—它们必须有实际意义\r\n重视现实性和常识性\r\n喜欢使用和琢磨已知的技能\r\n留心具体的和特殊的；进行细节描述\r\n循序渐进地讲述有关情况\r\n着眼于现实或现在\r\n'),('ff80808154d2fa5101554e6b0f0f058a','ff80808154d2fa5101554e6b0f0e0589',-60,0,'超前思考，考虑行为对他人的影响\r\n重视同情与和睦：重视准则的例外性\r\n给人快乐，容易理解别人\r\n被认为感情过多，缺少逻辑性，软弱\r\n认为圆通与坦率同样重要\r\n无论是否有意义，认为任何感情都可取\r\n为了获得欣赏而激励\r\n'),('ff80808154d2fa5101554e6b0f10058b','ff80808154d2fa5101554e6b0f0e0589',1,60,'退后一步思考，对问题进行客观的分析\r\n重视符合逻辑、公正、公平的价值；一视同仁\r\n容易发现缺点，有吹毛求疵的倾向，倾向于批评\r\n被认为冷酷、麻木、漠不关心\r\n认为圆通比坦率更重要\r\n'),('ff80808154d2fa510155521985f805d3','ff80808154d2fa5101554e71feaa058c',-60,0,'当各种选择都存在时，感到快乐\r\n“玩的原则”：先玩再完成工作(如果有时间的话)\r\n随着新信息的获取，不断改变目标\r\n喜欢适应新情况\r\n着重过程(重点在于如何完成工作)\r\n满足感来源于计划的开始\r\n认为时间是可更新的资源，而最后期限也是有收缩的\r\n'),('ff80808154d2fa510155521985f905d4','ff80808154d2fa5101554e71feaa058c',1,60,'做了决定后感到快乐\r\n有“工作原则”：先工作再玩（如果有时间的话）\r\n建立目标，并准时地完成\r\n愿意知道它们将面对的情况\r\n着重结果(重点在于完成任务)\r\n满足感来源于完成计划\r\n把时间看作有限的资源，认真地对待最后期限\r\n');
/*!40000 ALTER TABLE `review_report_grade` ENABLE KEYS */;
UNLOCK TABLES;

